import{_ as t,c as a,o,ae as r}from"./chunks/framework.6g521mOR.js";const i="/portfolio-site/about_me_photos/fam.jpg",n="/portfolio-site/assets/cbre_internship.D8rUP3Uh.jpeg",l="/portfolio-site/about_me_photos/xena_odin.jpeg",g=JSON.parse('{"title":"About Courtney","description":"","frontmatter":{},"headers":[],"relativePath":"about.md","filePath":"about.md"}'),s={name:"about.md"};function d(p,e,h,u,c,m){return o(),a("div",null,e[0]||(e[0]=[r('<h1 id="about-courtney" tabindex="-1">About Courtney <a class="header-anchor" href="#about-courtney" aria-label="Permalink to &quot;About Courtney&quot;">​</a></h1><p>Hi, I’m Courtney — a creative problem-solver, recent CS grad, and former restaurant manager turned software engineer.</p><p><img src="'+i+'" alt="Me with My Family at Graduation"></p><p>My journey didn’t start in tech — it started behind the bar. I worked my way up from bartender to Assistant General Manager at Flying Saucer, where I learned to manage people, solve operational challenges, and stay cool under pressure.</p><p>Eventually, I decided to chase something new. I took classes at Collin College and fell in love with programming. Logic puzzles and brain teasers have always been my thing — and it turns out, software development is full of them.</p><p>That realization led me to UT Dallas, where I earned my CS degree and built things I never thought possible:</p><ul><li>A virtual CPU</li><li>A color-matching ML model</li><li>A LEGO sorter powered by Raspberry Pi</li></ul><hr><h2 id="my-time-at-cbre" tabindex="-1">My Time at CBRE <a class="header-anchor" href="#my-time-at-cbre" aria-label="Permalink to &quot;My Time at CBRE&quot;">​</a></h2><p><img src="'+n+'" alt="Interning at CBRE"></p><p>During the summer of my senior year, I interned as a Software Engineer at CBRE on the Global Workplace Solutions team. It was my first experience contributing to large-scale systems in a corporate environment — and I absolutely loved it.</p><p>I worked closely with automation tools, helped transition processes into more scalable systems, and gained a deeper appreciation for how enterprise software actually runs behind the scenes.</p><p>The best part? Being surrounded by sharp, supportive people who encouraged me to ask questions and stay curious. I left the internship more confident in my skills and even more excited to keep building things that matter.</p><hr><h2 id="what-i-m-looking-for" tabindex="-1">What I&#39;m Looking For <a class="header-anchor" href="#what-i-m-looking-for" aria-label="Permalink to &quot;What I&#39;m Looking For&quot;">​</a></h2><p>I’m currently open to <strong>full-time software development roles</strong> — especially where I can keep learning and explore AI, systems, or creative tools.</p><ul><li>I thrive in collaborative, curious teams.</li><li>I enjoy technical challenges that blend design and logic.</li><li>I’m at my best when I’m experimenting, prototyping, or automating something unexpected.</li></ul><hr><h2 id="my-values-style" tabindex="-1">My Values &amp; Style <a class="header-anchor" href="#my-values-style" aria-label="Permalink to &quot;My Values &amp; Style&quot;">​</a></h2><div style="display:flex;align-items:flex-start;gap:1rem;margin-bottom:1rem;"><img src="'+l+'" alt="Xena and Odin" style="max-width:300px;border-radius:12px;"><p style="font-size:0.9rem;font-style:italic;margin:0;"> Xena (left) and Odin (right), my two very serious coworkers. Productivity is questionable, but morale is high! </p></div><ul><li>I’m thoughtful and deliberate — I like to understand the “why” before diving into the “how.”</li><li>I value clarity, kindness, and communication.</li><li>I believe knowledge grows when it’s shared — collaborating and lifting others up leads to better solutions.</li><li>My dream job is one where I get paid to learn.</li></ul><hr><h2 id="let-s-connect" tabindex="-1">Let’s Connect <a class="header-anchor" href="#let-s-connect" aria-label="Permalink to &quot;Let’s Connect&quot;">​</a></h2><p>If you:</p><ul><li>Need someone who can break down complex ideas clearly,</li><li>Appreciate curiosity and clever solutions,</li><li>Want to chat tech — or solve a logic puzzle just for fun...</li></ul><p>Then I’d love to hear from you!<br><a href="https://www.linkedin.com/in/courtneyspencer12/" target="_blank" rel="noreferrer">Reach me on LinkedIn</a> or <a href="/portfolio-site/projects.html">check out my projects</a>.</p>',26)]))}const b=t(s,[["render",d]]);export{g as __pageData,b as default};
